import {
  BrowserRouter as Router,
  Routes,
  Route,

} from "react-router-dom";

function App() {
  return (
    <Router>
      <Nav />
      <Routes>
        {/* <Route exact path="/" render={() => <Navigate to="/about" />} /> */}
        <Route path="/" exact element={<Home />} />
